description:
&quot;Where Are The Girls?: Th' Definitive Collection&quot; is a 2001 greatest hits album by New Zealand band Th' Dudes.
Compiled by the band themselves and co-ordinated by Simon Grigg.

Track listing

All songs written and composed by Dave Dobbyn and Ian Morris unless otherwise stated. 

1. &quot;Be Mine Tonight&quot;     
2. &quot;Bad Boy Billy&quot;     
3. &quot;Stop Crying&quot;     
4. &quot;Right First Time&quot;     
5. &quot;Tonight Again&quot;     
6. &quot;That look in Your Eyes&quot;     
7. &quot;Can't Get Over You At All&quot;     
8. &quot;On Sunday&quot;     
9. &quot;There You Are&quot;     
10. &quot;Walking in Light&quot;     
11. &quot;Until You Do&quot;     
12. &quot;Take It Back&quot;     
13. &quot;Bliss&quot;     
14. &quot;Something I Don't Need&quot;     
15. &quot;On The Rox&quot; (Written by Peter Urlich)   
16. &quot;All My Lovers&quot;     
17. &quot;You Can Make Me Dance&quot;     
18. &quot;Walking in Light (Live at 22M)&quot;     
19. &quot;Quite Frankly (Live at Vidcom)&quot;   

Ripped from CD in FLAC format using EAC.

Enjoy
